  [],\n\t\"revision_timestamp\": \"2016-07-27T23:05:02.222402\",\n\t\"name\": \"anuran-call-count-survey-canaan-valley-national-wildlife-refuge-summary-1999-2007\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Canaan Valley National Wildlife Refuge
  contains approximately 30% of West Virginia's wetlands. These wetlands are comprised
  of a variety of habitats including natural wetlands like streams, rivers, beaver
  ponds, vernal pools, river backwaters, and small bogs and man-made wetlands including
  equipment ruts, quarries, farm ponds, and ditches. Canaan Valley is home to 15 salamander
  species, 5 frog species, and 1 toad species. This represents approximately 44% of
  all salamander species and 40% of all frogs and toad species found in West Virginia.
  Because the refuge was established, in part, to protect the vast wetlands found
  in Canaan Valley, monitoring the health of those wetlands and future changes to
  their composition are crucial to the mission of the refuge. Therefore, Canaan Valley
  National Wildlife Refuge began participation in the anuran monitoring program at
  its inception in 1999 (with surveys beginning in 2000). This is a summary of those
  efforts.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
